(149, 1, '2020-10-07 20:26:16', '2020-10-07 13:26:16', '[run slide_id=\"6\"]\r\n<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\"><strong>KTX Tân Bình Phòng 4-6 người - Nam/Nữ</strong></div>\r\n</div>\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<blockquote>\r\n<div dir=\"auto\"><strong>CÒN BÀI ĐĂNG - CHẮC CHẮN CÒN GIƯỜNG / PHÒNG</strong></div></blockquote>\r\n</div>\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">BẢNG GIÁ GỐC: Giá đã bao gồm mọi chi phí, cam kết không phát sinh thêm.</div>\r\n<div dir=\"auto\">1. Phòng 4 người: 1tr630/ người</div>\r\n<div dir=\"auto\">2. Phòng 6 người: 1tr530/ người</div>\r\n</div>\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<blockquote>\r\n<div dir=\"auto\"><strong>===&gt; ƯU ĐÃI MÙA TỰU TRƯỜNG - GIẢM TỪ 300K - 500K TÙY LOẠI PHÒNG VÀ ƯU ĐÃI MẠNH VỚI NHÓM BẠN Ở CHUNG &lt;===</strong></div></blockquote>\r\n</div>\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">BẠN SẼ NHẬN ĐƯỢC:</div>\r\n<div dir=\"auto\">- Giờ giấc tự do ra vào thoải mái</div>\r\n<div dir=\"auto\">- Hệ thống camera đảm bảo an ninh</div>\r\n<div dir=\"auto\">- Giường rộng rãi thoải mái, trang bị rèm che kín đáo, tạo cảm giác riêng tư.</div>\r\n<div dir=\"auto\">- Internet tốc độ cao, wifi từng tầng.</div>\r\n<div dir=\"auto\">- Nhà vệ sinh rộng rãi, sạch sẽ riêng biệt từng phòng</div>\r\n<div dir=\"auto\">- Bếp chung có sẵn bếp hồng ngoại, kệ rửa, bàn ăn...</div>\r\n<div dir=\"auto\">- Mỗi phòng đều được trang bị máy lạnh, quạt treo tường, quạt thông gió để đảm bảo sự mát mẻ và thông thoáng</div>\r\n<div dir=\"auto\">- Giường kích thước 1m, các ký túc xá khác thường dùng giường 80cm.</div>\r\n<div dir=\"auto\">- Chăn drap gối nệm cao cấp.</div>\r\n<div dir=\"auto\">- Mỗi người được cung cấp một tủ quần áo lớn bằng gỗ</div>\r\n<div dir=\"auto\">- Đầy đủ các tiện nghi như tủ lạnh, máy giặt, hệ thống giàn phơi ....</div>\r\n</div>\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">P/s: Cảm ơn các bạn đã đọc tin, trong trường hợp gọi điện không nghe máy, bạn để lại lời nhắn, mình sẽ gọi lại.</div>\r\n</div>', 'KTX Tân Bình Phòng 4-6 người - Nam/Nữ', '', 'inherit', 'closed', 'closed', '', '123-revision-v1', '', '', '2020-10-07 20:26:16', '2020-10-07 13:26:16', '', 123, 'https://blog.phong123.com/123-revision-v1/', 0, 'revision', '', 0),
