(153, 1, '2020-10-08 08:26:25', '2020-10-08 01:26:25', '<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<h2 dir=\"auto\"><img class=\"alignnone size-medium\" src=\"https://i.imgur.com/yTlEJRm.png\" width=\"960\" height=\"720\" /></h2>\r\n<h2 dir=\"auto\">Mất cân bằng trong sinh hoạt</h2>\r\n<h2 dir=\"auto\">Các bạn đã bao giờ rơi vào trường hợp như tôi chưa ??</h2>\r\n<div dir=\"auto\">Là một sinh viên năm 1 với bao nhiêu hoài bão và mang trong mình suy nghĩ độc lập về mọi việc</div>\r\n<div dir=\"auto\">Nhưng các bạn đã bị gáo nước lạnh không ??</div>\r\n<div dir=\"auto\">- Cuộc sống lôi thôi , cẩu thả không có một hệ thống gì cả.</div>\r\n<div dir=\"auto\">- Lãng phí tiền bạc để đi ăn uống bên ngoài .</div>\r\n<div dir=\"auto\">- Không tự giác trong việc học</div>\r\n<div dir=\"auto\">- Mất tập trung khi xung quanh rất ồn ào bởi những người cùng phòng chơi game , bật nhạc , trò chuyện ...</div>\r\n<div dir=\"auto\">- Thức khuya khi xung quanh khu mình sống toàn những bạn hay thức khuya và có tình trạng bật đèn suốt đêm .</div>\r\n</div>\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">Nhưng từ khi chuyển vào một nơi mới cuộc sống của tôi đã dần được ổn định .</div>\r\n<blockquote>\r\n<div dir=\"auto\">KTX GREENHOUSE - 51/14B Giải Phóng Phường 4 Quận Tân Bình</div></blockquote>\r\n<div dir=\"auto\">Một nơi sinh sống đầy thân thiện, ý thức , tôn trọng quyền sống của mỗi người .</div>\r\n<div dir=\"auto\">Tại đây với khu sinh hoạt vừa có người đi làm và sinh viên đi học tạo ra hệ sinh thái cực kì tốt để hòa quyện vào đây</div>\r\n<ul>\r\n 	<li dir=\"auto\">GreenHouse trang bị khu bếp sinh hoạt chung để mọi người có thể nấu ăn để tiết kiệm thêm chi phí.Tại đây còn có những anh chị vui tính sẵn sàng chỉ nấu ăn cho các bạn chưa từng nấu ăn .</li>\r\n 	<li dir=\"auto\">Với một môi trường ý thức cao thì ý thức sống dành cho mọi người đều được tôn trọng . Không gian mọi người dành cho nhau là sự yên tĩnh .</li>\r\n 	<li dir=\"auto\">Vì sao ?? Người đi làm cần được nghỉ ngơi sau một đêm dài .</li>\r\n 	<li dir=\"auto\">Việc học tập cũng rất tốt cho các bạn khi ở đây là các bạn sinh viên đang học và sắp ra trường , rất tiện để trao đổi học hỏi thêm .</li>\r\n 	<li dir=\"auto\">Và đặc biệt hơn GreenHouse mang lại cho mọi người một cuộc sống đầy thoải mái và đầy thoáng mát với mỗi ngày đều có người dọn dẹp từ trong ra ngoài để mọi người sinh sống với chất lượng cao nhất .</li>\r\n</ul>\r\n</div>', 'Mất cân bằng trong sinh hoạt', '', 'publish', 'open', 'open', '', 'mat-can-bang-trong-sinh-hoat', '', '', '2020-10-08 08:34:19', '2020-10-08 01:34:19', '', 0, 'https://blog.phong123.com/?p=153', 0, 'post', '', 0),
(154, 1, '2020-10-08 08:26:25', '2020-10-08 01:26:25', '<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<h2 dir=\"auto\">Mất cân bằng trong sinh hoạt</h2>\r\n<h2 dir=\"auto\">Các bạn đã bao giờ rơi vào trường hợp như tôi chưa ??</h2>\r\n<div dir=\"auto\">Là một sinh viên năm 1 với bao nhiêu hoài bão và mang trong mình suy nghĩ độc lập về mọi việc</div>\r\n<div dir=\"auto\">Nhưng các bạn đã bị gáo nước lạnh không ??</div>\r\n<div dir=\"auto\">- Cuộc sống lôi thôi , cẩu thả không có một hệ thống gì cả.</div>\r\n<div dir=\"auto\">- Lãng phí tiền bạc để đi ăn uống bên ngoài .</div>\r\n<div dir=\"auto\">- Không tự giác trong việc học</div>\r\n<div dir=\"auto\">- Mất tập trung khi xung quanh rất ồn ào bởi những người cùng phòng chơi game , bật nhạc , trò chuyện ...</div>\r\n<div dir=\"auto\">- Thức khuya khi xung quanh khu mình sống toàn những bạn hay thức khuya và có tình trạng bật đèn suốt đêm .</div>\r\n</div>\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">Nhưng từ khi chuyển vào một nơi mới cuộc sống của tôi đã dần được ổn định .</div>\r\n<blockquote>\r\n<div dir=\"auto\">KTX GREENHOUSE - 51/14B Giải Phóng Phường 4 Quận Tân Bình</div></blockquote>\r\n<div dir=\"auto\">Một nơi sinh sống đầy thân thiện, ý thức , tôn trọng quyền sống của mỗi người .</div>\r\n<div dir=\"auto\">Tại đây với khu sinh hoạt vừa có người đi làm và sinh viên đi học tạo ra hệ sinh thái cực kì tốt để hòa quyện vào đây</div>\r\n<ul>\r\n 	<li dir=\"auto\">GreenHouse trang bị khu bếp sinh hoạt chung để mọi người có thể nấu ăn để tiết kiệm thêm chi phí.Tại đây còn có những anh chị vui tính sẵn sàng chỉ nấu ăn cho các bạn chưa từng nấu ăn .</li>\r\n 	<li dir=\"auto\">Với một môi trường ý thức cao thì ý thức sống dành cho mọi người đều được tôn trọng . Không gian mọi người dành cho nhau là sự yên tĩnh .</li>\r\n 	<li dir=\"auto\">Vì sao ?? Người đi làm cần được nghỉ ngơi sau một đêm dài .</li>\r\n 	<li dir=\"auto\">Việc học tập cũng