ạn khi ở đây là các bạn sinh viên đang học và sắp ra trường , rất tiện để trao đổi học hỏi thêm .</li>\n 	<li dir=\"auto\">Và đặc biệt hơn GreenHouse mang lại cho mọi người một cuộc sống đầy thoải mái và đầy thoáng mát với mỗi ngày đều có người dọn dẹp từ trong ra ngoài để mọi người sinh sống với chất lượng cao nhất .</li>\n</ul>\n</div>', 'Mất cân bằng trong sinh hoạt', '', 'inherit', 'closed', 'closed', '', '153-autosave-v1', '', '', '2020-10-08 08:29:31', '2020-10-08 01:29:31', '', 153, 'https://blog.phong123.com/153-autosave-v1/', 0, 'revision', '', 0),
(159, 1, '2020-10-08 08:34:19', '2020-10-08 01:34:19', '<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<h2 dir=\"auto\"><img class=\"alignnone size-medium\" src=\"https://i.imgur.com/yTlEJRm.png\" width=\"960\" height=\"720\" /></h2>\r\n<h2 dir=\"auto\">Mất cân bằng trong sinh hoạt</h2>\r\n<h2 dir=\"auto\">Các bạn đã bao giờ rơi vào trường hợp như tôi chưa ??</h2>\r\n<div dir=\"auto\">Là một sinh viên năm 1 với bao nhiêu hoài bão và mang trong mình suy nghĩ độc lập về mọi việc</div>\r\n<div dir=\"auto\">Nhưng các bạn đã bị gáo nước lạnh không ??</div>\r\n<div dir=\"auto\">- Cuộc sống lôi thôi , cẩu thả không có một hệ thống gì cả.</div>\r\n<div dir=\"auto\">- Lãng phí tiền bạc để đi ăn uống bên ngoài .</div>\r\n<div dir=\"auto\">- Không tự giác trong việc học</div>\r\n<div dir=\"auto\">- Mất tập trung khi xung quanh rất ồn ào bởi những người cùng phòng chơi game , bật nhạc , trò chuyện ...</div>\r\n<div dir=\"auto\">- Thức khuya khi xung quanh khu mình sống toàn những bạn hay thức khuya và có tình trạng bật đèn suốt đêm .</div>\r\n</div>\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">Nhưng từ khi chuyển vào một nơi mới cuộc sống của tôi đã dần được ổn định .</div>\r\n<blockquote>\r\n<div dir=\"auto\">KTX GREENHOUSE - 51/14B Giải Phóng Phường 4 Quận Tân Bình</div></blockquote>\r\n<div dir=\"auto\">Một nơi sinh sống đầy thân thiện, ý thức , tôn trọng quyền sống của mỗi người .</div>\r\n<div dir=\"auto\">Tại đây với khu sinh hoạt vừa có người đi làm và sinh viên đi học tạo ra hệ sinh thái cực kì tốt để hòa quyện vào đây</div>\r\n<ul>\r\n 	<li dir=\"auto\">GreenHouse trang bị khu bếp sinh hoạt chung để mọi người có thể nấu ăn để tiết kiệm thêm chi phí.Tại đây còn có những anh chị vui tính sẵn sàng chỉ nấu ăn cho các bạn chưa từng nấu ăn .</li>\r\n 	<li dir=\"auto\">Với một môi trường ý thức cao thì ý thức sống dành cho mọi người đều được tôn trọng . Không gian mọi người dành cho nhau là sự yên tĩnh .</li>\r\n 	<li dir=\"auto\">Vì sao ?? Người đi làm cần được nghỉ ngơi sau một đêm dài .</li>\r\n 	<li dir=\"auto\">Việc học tập cũng rất tốt cho các bạn khi ở đây là các bạn sinh viên đang học và sắp ra trường , rất tiện để trao đổi học hỏi thêm .</li>\r\n 	<li dir=\"auto\">Và đặc biệt hơn GreenHouse mang lại cho mọi người một cuộc sống đầy thoải mái và đầy thoáng mát với mỗi ngày đều có người dọn dẹp từ trong ra ngoài để mọi người sinh sống với chất lượng cao nhất .</li>\r\n</ul>\r\n</div>', 'Mất cân bằng trong sinh hoạt', '', 'inherit', 'closed', 'closed', '', '153-revision-v1', '', '', '2020-10-08 08:34:19', '2020-10-08 01:34:19', '', 153, 'https://blog.phong123.com/153-revision-v1/', 0, 'revision', '', 0),
(160, 1, '2020-10-08 08:35:03', '2020-10-08 01:35:03', '<img src=\"https://i.imgur.com/yTlEJRm.png\" width=\"960\" height=\"720\" class=\"alignnone size-medium\" />\r\n<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">Các bạn thường gặp khó khăn gì khi đi sống ở một thành phố mới?</div>\r\n<ol>\r\n 	<li dir=\"auto\"><strong>Chưa tìm được môi trường tốt</strong></li>\r\n 	<li dir=\"auto\"><strong>Thiếu các trang thiết bị cơ bản</strong></li>\r\n</ol>\r\n</div>\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">Nhưng đối với KTX GreenHouse sẽ đáp ứng và giải quyết cho các bạn .</div>\r\n<div dir=\"auto\"><strong>1.Tại đây môi trường GreenHouse có người đi làm và sinh viên đi học .</strong></div>\r\n<div dir=\"auto\">Nhưng điều gì GreenHouse cho là đây là môi trường tốt ?</div>\r\n<div dir=\"auto\">** Ý thức ** Với văn hóa GreenHouse đã xây dựng được tính ngăn nắp ,gọn gàng khi thường xuyên dọn dẹp sạch sẽ với chất lượng 5sao .</div>\r\n<div dir=\"auto\">** Học thức cao** Khi các bạn vào đây sẽ có những người bạn , anh chị rất thân thiện đã gắn bó với GreenHouse từ khi GreenHouse xây dựng lên và nhờ vậy mà làm tăng giá trị cho GreenHouse .</div>\r\n<div dir=\"auto\">Cơ hội để học tập và phát triển tại chính nơi mình đang sống</div>\r\n<div dir=\"auto\"><strong>2. GreenHouse tạo điều kiện cho tất cả mọi người về các trang thiết bị thiết yếu để phục vụ cuộc sống hằng ngày cho mọi người .</strong></div>\r\n<div dir=\"auto\">Phòng ngủ trang bị : Nệm,chăn,ga,gối, nệm, hộc tủ riêng và máy lạnh.</div>\r\n<div dir=\"auto\">Phòng bếp : Tủ lạnh , dụng cụ nấu ăn và không gian nấu ăn .</div>\r\n<div dir=\"auto\">Sân thượng : phục vụ khu nghỉ ngơi cho những người bạn thích thư giản sau một ngày dài</div>\r\n</div>\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">Tất cả GreenHouse đều tặng Free cho tất cả các bạn</div>\r\n</div>\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<blockquote>\r\n<div dir=\"auto\">Địa chỉ : 51/14B Giải Phóng P4 Quận Tân Bình</div></blockquote>\r\n<div dir=\"auto\">Liên hệ để được tư vấn hoàn toàn miễn phí và có cơ hội nhận được những ưu đãi khác dành riêng cho các bạn thân yêu</div>\r\n</div>', 'Các bạn thường gặp khó khăn gì khi đi sống ở một thành phố mới?', '', 'inherit', 'closed', 'closed', '', '155-revision-v1', '', '', '2020-10-08 08:35:03', '2020-10-08 01:35:03', '', 155, 'https://blog.phong123.com/155-revision-v1/', 0, 'revision', '', 0);

